export default (function(a,b,c,d,e,f,g){return {data:{JEtxqoWmIF:{data:{id:580,attributes:{imdbId:"tt0042327",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYzhkNDFkYjktM2IyMS00YjVhLWExYjUtMTE3YjY1NDEyOTAyXkEyXkFqcGdeQXVyNjE5MjUyOTM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"24%"}],item_lang:{data:{id:1243,attributes:{title:b,plot:"\"Cheaper By the Dozen\", based on the real-life story of the Gilbreth family, follows them from Providence, Rhode Island to Montclair, New Jersey, and details the amusing anecdotes found in large families. Frank Gilbreth, Sr., was a pioneer in the field of motion study, and often used his family as guinea pigs (with amusing and sometimes embarrassing results). He resisted popular culture,railing against his daughters' desires for bobbed hair and cosmetics.",slug:"cheaper-by-the-dozen"}}},books:{data:[{id:4130,attributes:{title:b,description:"\"The riotous escapades of the twelve Gilbreth children and Dad, the famous efficiency expert who believes a family can be run like a factory\"--Inside front dust-jacket.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5PSe1fgDlScC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e,c],firstBook:true,published:"1993-01-01",publisher:"Wheeler Publishing, Incorporated",subtitle:a}},{id:4131,attributes:{title:b,description:"The #1 New York Times–bestselling classic: A hilarious memoir of two parents, twelve kids, and “a life of cheerfully controlled chaos” (The New York Times). Translated into more than fifty languages, Cheaper by the Dozen is the unforgettable story of the Gilbreth clan as told by two of its members. In this endearing, amusing memoir, siblings Frank Jr. and Ernestine capture the hilarity and heart of growing up in an oversized family. Mother and Dad are world-renowned efficiency experts, helping factories fine-tune their assembly lines for maximum output at minimum cost. At home, the Gilbreths themselves have cranked out twelve kids, and Dad is out to prove that efficiency principles can apply to family as well as the workplace. The heartwarming and comic stories of the jumbo-size Gilbreth clan have delighted generations of readers, and will keep you and yours laughing for years. This ebook features an illustrated biography including rare photos from the authors’ estates.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dQRPAQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f,c],firstBook:d,published:"2013-11-05",publisher:g,subtitle:a}},{id:4132,attributes:{title:b,description:"The hilarious, heartwarming classic that inspired the major motion picture from Twentieth Century Fox Cheaper by the Dozen with Steve Martin.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=87wWRR04KhUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:d,published:"2002-01-01",publisher:a,subtitle:a}},{id:4133,attributes:{title:"Cheaper by the Dozen - Musical",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aT0PW4tiuKEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Frank B Gilbreth, Jr",c],firstBook:d,published:"1969-01-01",publisher:"Dramatic Publishing",subtitle:a}},{id:4134,attributes:{title:"Cheaper by the Dozen and Belles on Their Toes",description:"The hilarious and heartwarming #1 New York Times bestseller and its beloved sequel about a larger-than-life family with twelve kids. Cheaper by the Dozen: Made into two classic movies—one starring Clifton Webb and the other starring Steve Martin—and translated into more than fifty languages, Cheaper by the Dozen is an amusing, endearing, and unforgettable memoir of the Gilbreth clan as told by siblings Frank Jr. and Ernestine Gilbreth. Mother and Dad are world-renowned efficiency experts, helping factories fine-tune their assembly lines for maximum output at minimum cost. At home, the Gilbreths themselves have cranked out twelve kids, and Dad is out to prove that efficiency principles can apply to family as well as the workplace—with riotous results. “A touching family portrait that also happens to be very, very funny.” —Jonathan Yardley, The Washington Post Belles on Their Toes: With twelve kids, life at the Gilbreth house has always been a big project. But after their father passes away, there are more challenges than ever. As their resourceful mother works to keep the family business running, the kids tackle the adventures of raising themselves and running a household. With the irrepressible blend of humor and good cheer characteristic of one of the most beloved families in America, the Gilbreths rise to every occasion and find a way to keep it all together. Belles on Their Toes was also made into a movie with Myrna Loy and Jeanne Crain reprising their roles. “There is a sincere and heartwarming atmosphere in this second volume that makes it almost better reading, if possible, than the first.” —Library Journal",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cIRaDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f,c],firstBook:d,published:"2018-05-22",publisher:g,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940940464}}("","Cheaper by the Dozen","Ernestine Gilbreth Carey",null,"Frank Bunker Gilbreth","Frank B. Gilbreth","Open Road Media"))